INSERT INTO `comments` VALUES (1,'Полина Иванова','Заказывала ботинки для своего молодого человека. Привезли как и договаривались на следующий день. Качество отличное. Спасибо за оперативную доставку и качественный сервис.',1476784953,'91.224.207.219'),(2,'Михаил Мейко','Заказывал себе зимние ботинки, все понравилось, качество хорошее буду обращаться еще.',1476785034,'91.224.207.219'),(3,'Илья Денисов','Здравствуйте! Хочу поблагодарить данный магазин за оперативную и честную работу. Ботинки ношу с удовольствием. Ребята, желаю вам успехов!',1476785045,'91.224.207.219'),(4,'Сергей Лепихов','Уже как неделю хожу в новых ботинках, нет ни единого нарекания, все пришло в срок\nБезумно доволен своей покупкой))',1476785055,'91.224.207.219');
